import React, { Component } from "react";
import Navbar from "./navbar";
import Login from "./login";

class Home extends Component{
    state = {
        toggleLogin: false,
    };

    handleLogin = () => {
        this.state({toggleLogin: !this.state.toggleLogin})
    }

    render() {
        return (
            <React.Fragment>
                <Navbar/>
                {this.toggleLogin && <Login />}

                <button onClick={this.handleLogin} className="btn btn-primary m-5">
                    Login
                </button>
            </React.Fragment>
        );
    }
}
export default Home;
